import React from 'react';
import { BrowserRouter, Route, Switch } from "react-router-dom";

import App from "../App";
import job from "job";

const Router = () => (

    <BrowserRouter>
        <switch>
        <Route path="/" component={App} />
        <Route path="/job" component={job} />
        </switch>
    </BrowserRouter>
);
